// src/components/TransactionComponent/transaction-list.js
import React from "react";
import { Row, Col, Card, Button } from "react-bootstrap";

const TransactionList = ({ transactions }) => {
  return (
    <Row>
      {transactions.map((transaction) => (
        <Col
          key={transaction.transactionId}
          xs={12}
          sm={6}
          md={4}
          lg={3}
          className="mb-4"
        >
          <Card>
            <Card.Body>
              <Card.Title>{transaction.description}</Card.Title>
              <Card.Text as="div">
                <div>
                  <strong>Date:</strong> {transaction.transactionDate}
                </div>
                <div>
                  <strong>Amount:</strong> ${transaction.amount}
                </div>
                <div>
                  <strong>Type:</strong> {transaction.transactionType}
                </div>
                {transaction.recurring && (
                  <div>
                    <strong>Recurring:</strong> Yes
                  </div>
                )}
                {transaction.recurringFrequency && (
                  <div>
                    <strong>Frequency:</strong> {transaction.recurringFrequency}
                  </div>
                )}
                {transaction.relatedTransactionId && (
                  <div>
                    <strong>Related Transaction:</strong>{" "}
                    {transaction.relatedTransactionId}
                  </div>
                )}
              </Card.Text>
              <div className="d-flex justify-content-between">
                <Button variant="danger">Delete Transaction</Button>
              </div>
            </Card.Body>
          </Card>
        </Col>
      ))}
    </Row>
  );
};

export default TransactionList;
